package com.hq.bean;public class Pictures implements java.io.Serializable {	private long id;	private long house_id;	private String dis;	private String path;	private String mime;	private String orgname;	private int channel;	private int level;	public long getId() {		return id;	}	public void setId(long id) {		this.id = id;	}	public long getHouse_id() {		return house_id;	}	public void setHouse_id(long house_id) {		this.house_id = house_id;	}	public String getDis() {		return dis;	}	public void setDis(String dis) {		this.dis = dis;	}	public String getPath() {		return path;	}	public void setPath(String path) {		this.path = path;	}	public String getMime() {		return mime;	}	public void setMime(String mime) {		this.mime = mime;	}	public String getOrgname() {		return orgname;	}	public void setOrgname(String orgname) {		this.orgname = orgname;	}	public int getChannel() {		return channel;	}	public void setChannel(int channel) {		this.channel = channel;	}	public int getLevel() {		return level;	}	public void setLevel(int level) {		this.level = level;	}}